pub enum ErrorVariant<R> {
    ParsingError {
        positives: Vec<R>,
        negatives: Vec<R>,
    },
    CustomError {
        message: String,
    },
}

pub enum LineColLocation {
    Pos((usize, usize)),
    Span((usize, usize), (usize, usize)),
}

pub enum Token<'i, R> {
    Start {
        rule: R,
        pos: Position,
    },
    End {
        rule: R,
        pos: Position,
    },
}
